import './App.css';
import { ToastContainer } from 'react-toastify'; 
import 'react-toastify/dist/React-toastify.css'

function App() {
  return (
    <div className="App">
      <ToastContainer  position="top-center">
        <h2>Hello react</h2>
      </ToastContainer>
    </div>
  );
}

export default App;
